//import
import React from "react";
import Result from "./components/Result";
import Button from "./components/Button"
import "./App.css";

// generate
const App = () => {
  return (
    <main className="react-calculator">
      <Result value={0} ></Result>
      <div className="numbers">
        <Button text="1" type="number"></Button>
        <Button text="2" type="number"></Button>
        <Button text="3" type="number"></Button>
        <Button text="4" type="number"></Button>
        <Button text="5" type="number"></Button>
        <Button text="6" type="number"></Button>
        <Button text="7" type="number"></Button>
        <Button text="8" type="number"></Button>
        <Button text="9" type="number"></Button>
        <Button text="10" type="number"></Button>
      </div>
      <div className="functions">
        <button>Clear</button>
        <button>r</button>
      </div>
      <div className="math-operations">
        <button>+</button>
        <button>-</button>
        <button>*</button>
        <button>/</button>
        <button>=</button>
      </div>
    </main>
  );
};

//export
export default App;
